import { ReactComponent as bgPromotion } from "../images/bg-promotion.svg";


function Cupom(props) {
    const banner = `url('${props.bgPromotion}') no-repeat center/cover`;
    return (
        <div className="banner-cupom" style={{ banner }}>
            <h1>Cupom</h1>
        </div>
    );
}

export default Cupom;
